import React, { useState, useEffect } from 'react';

interface ShoppingItem {
  id: string;
  name: string;
  category: 'fruits' | 'vegetables' | 'proteins' | 'grains' | 'dairy' | 'other';
  priority: 'high' | 'medium' | 'low';
  isCompleted: boolean;
  notes?: string;
  nutritionBenefits?: string[];
}

interface ShoppingListManagerProps {
  items: ShoppingItem[];
  onUpdate: (items: ShoppingItem[]) => void;
}

const ShoppingListManager: React.FC<ShoppingListManagerProps> = ({ 
  items, 
  onUpdate 
}) => {
  const [newItemName, setNewItemName] = useState('');
  const [selectedCategory, setSelectedCategory] = useState<ShoppingItem['category']>('other');
  const [filter, setFilter] = useState<'all' | 'pending' | 'completed'>('all');

  const categories = [
    { id: 'fruits', label: 'Fruits', icon: '🍎', color: '#ef4444' },
    { id: 'vegetables', label: 'Vegetables', icon: '🥕', color: '#10b981' },
    { id: 'proteins', label: 'Proteins', icon: '🥩', color: '#8b5cf6' },
    { id: 'grains', label: 'Grains', icon: '🌾', color: '#f59e0b' },
    { id: 'dairy', label: 'Dairy', icon: '🥛', color: '#06b6d4' },
    { id: 'other', label: 'Other', icon: '🛒', color: '#6b7280' }
  ] as const;

  const addItem = () => {
    if (!newItemName.trim()) return;

    const newItem: ShoppingItem = {
      id: Date.now().toString(),
      name: newItemName.trim(),
      category: selectedCategory,
      priority: 'medium',
      isCompleted: false,
      nutritionBenefits: generateNutritionBenefits(newItemName, selectedCategory)
    };

    onUpdate([...items, newItem]);
    setNewItemName('');
  };

  const toggleItem = (id: string) => {
    const updatedItems = items.map(item =>
      item.id === id ? { ...item, isCompleted: !item.isCompleted } : item
    );
    onUpdate(updatedItems);
  };

  const removeItem = (id: string) => {
    const updatedItems = items.filter(item => item.id !== id);
    onUpdate(updatedItems);
  };

  const generateNutritionBenefits = (name: string, category: ShoppingItem['category']): string[] => {
    const benefits: Record<string, string[]> = {
      fruits: ['High in vitamins', 'Natural antioxidants', 'Fiber for digestion'],
      vegetables: ['Essential minerals', 'Low in calories', 'High fiber content'],
      proteins: ['Muscle building', 'Amino acids', 'Satiety'],
      grains: ['Energy source', 'B vitamins', 'Complex carbs'],
      dairy: ['Calcium', 'Protein', 'Probiotics'],
      other: ['Various nutrients', 'Balanced nutrition']
    };
    return benefits[category] || benefits.other;
  };

  const filteredItems = items.filter(item => {
    switch (filter) {
      case 'pending': return !item.isCompleted;
      case 'completed': return item.isCompleted;
      default: return true;
    }
  });

  const getCategoryInfo = (categoryId: string) => 
    categories.find(cat => cat.id === categoryId) || categories[5];

  return (
    <div style={{ maxWidth: '600px', margin: '0 auto' }}>
      <h3 style={{ 
        margin: '0 0 20px 0', 
        color: '#1e293b',
        display: 'flex',
        alignItems: 'center',
        gap: '8px'
      }}>
        🛒 Smart Shopping List
      </h3>

      {/* Add Item Form */}
      <div style={{
        backgroundColor: '#f8fafc',
        padding: '16px',
        borderRadius: '8px',
        marginBottom: '20px'
      }}>
        <div style={{
          display: 'flex',
          gap: '8px',
          marginBottom: '12px',
          flexWrap: 'wrap'
        }}>
          <input
            type="text"
            value={newItemName}
            onChange={(e) => setNewItemName(e.target.value)}
            placeholder="Add healthy item..."
            onKeyPress={(e) => e.key === 'Enter' && addItem()}
            style={{
              flex: 1,
              minWidth: '200px',
              padding: '8px 12px',
              border: '1px solid #d1d5db',
              borderRadius: '6px',
              fontSize: '14px'
            }}
          />
          <select
            value={selectedCategory}
            onChange={(e) => setSelectedCategory(e.target.value as ShoppingItem['category'])}
            style={{
              padding: '8px 12px',
              border: '1px solid #d1d5db',
              borderRadius: '6px',
              fontSize: '14px'
            }}
          >
            {categories.map(cat => (
              <option key={cat.id} value={cat.id}>
                {cat.icon} {cat.label}
              </option>
            ))}
          </select>
          <button
            onClick={addItem}
            disabled={!newItemName.trim()}
            style={{
              padding: '8px 16px',
              backgroundColor: !newItemName.trim() ? '#d1d5db' : '#3b82f6',
              color: 'white',
              border: 'none',
              borderRadius: '6px',
              cursor: !newItemName.trim() ? 'not-allowed' : 'pointer',
              fontSize: '14px',
              fontWeight: '500'
            }}
          >
            Add
          </button>
        </div>
      </div>

      {/* Filter Buttons */}
      <div style={{
        display: 'flex',
        gap: '8px',
        marginBottom: '16px'
      }}>
        {(['all', 'pending', 'completed'] as const).map(filterType => (
          <button
            key={filterType}
            onClick={() => setFilter(filterType)}
            style={{
              padding: '6px 12px',
              border: '1px solid #d1d5db',
              borderRadius: '6px',
              backgroundColor: filter === filterType ? '#3b82f6' : 'white',
              color: filter === filterType ? 'white' : '#64748b',
              cursor: 'pointer',
              fontSize: '12px',
              fontWeight: '500',
              textTransform: 'capitalize'
            }}
          >
            {filterType} ({
              filterType === 'all' ? items.length :
              filterType === 'pending' ? items.filter(i => !i.isCompleted).length :
              items.filter(i => i.isCompleted).length
            })
          </button>
        ))}
      </div>

      {/* Shopping List Items */}
      <div style={{ maxHeight: '400px', overflowY: 'auto' }}>
        {filteredItems.length === 0 ? (
          <div style={{
            textAlign: 'center',
            padding: '40px',
            color: '#64748b'
          }}>
            <div style={{ fontSize: '48px', marginBottom: '12px' }}>🛒</div>
            <div style={{ fontSize: '14px' }}>
              {filter === 'all' ? 'No items in your list yet' : 
               filter === 'pending' ? 'No pending items' : 'No completed items'}
            </div>
          </div>
        ) : (
          <div style={{ display: 'flex', flexDirection: 'column', gap: '8px' }}>
            {filteredItems.map(item => {
              const categoryInfo = getCategoryInfo(item.category);
              return (
                <div
                  key={item.id}
                  style={{
                    display: 'flex',
                    alignItems: 'flex-start',
                    gap: '12px',
                    padding: '12px',
                    backgroundColor: item.isCompleted ? '#f0fdf4' : 'white',
                    border: '1px solid #e5e7eb',
                    borderRadius: '8px',
                    opacity: item.isCompleted ? 0.7 : 1
                  }}
                >
                  <input
                    type="checkbox"
                    checked={item.isCompleted}
                    onChange={() => toggleItem(item.id)}
                    style={{
                      marginTop: '2px',
                      cursor: 'pointer'
                    }}
                  />
                  
                  <div style={{ flex: 1 }}>
                    <div style={{
                      display: 'flex',
                      alignItems: 'center',
                      gap: '8px',
                      marginBottom: '4px'
                    }}>
                      <span style={{ 
                        fontSize: '16px',
                        color: categoryInfo.color 
                      }}>
                        {categoryInfo.icon}
                      </span>
                      <span style={{
                        fontSize: '14px',
                        fontWeight: '500',
                        color: item.isCompleted ? '#64748b' : '#1e293b',
                        textDecoration: item.isCompleted ? 'line-through' : 'none'
                      }}>
                        {item.name}
                      </span>
                      <span style={{
                        fontSize: '11px',
                        padding: '2px 6px',
                        backgroundColor: categoryInfo.color,
                        color: 'white',
                        borderRadius: '10px'
                      }}>
                        {categoryInfo.label}
                      </span>
                    </div>
                    
                    {item.nutritionBenefits && (
                      <div style={{
                        fontSize: '12px',
                        color: '#64748b',
                        display: 'flex',
                        flexWrap: 'wrap',
                        gap: '4px'
                      }}>
                        {item.nutritionBenefits.map((benefit, index) => (
                          <span
                            key={index}
                            style={{
                              backgroundColor: '#f1f5f9',
                              padding: '2px 6px',
                              borderRadius: '4px'
                            }}
                          >
                            {benefit}
                          </span>
                        ))}
                      </div>
                    )}
                  </div>
                  
                  <button
                    onClick={() => removeItem(item.id)}
                    style={{
                      background: 'none',
                      border: 'none',
                      color: '#ef4444',
                      cursor: 'pointer',
                      fontSize: '16px',
                      padding: '4px'
                    }}
                    title="Remove item"
                  >
                    ✕
                  </button>
                </div>
              );
            })}
          </div>
        )}
      </div>

      {/* Summary */}
      {items.length > 0 && (
        <div style={{
          marginTop: '20px',
          padding: '16px',
          backgroundColor: '#f8fafc',
          borderRadius: '8px',
          display: 'flex',
          justifyContent: 'space-between',
          alignItems: 'center',
          fontSize: '14px',
          color: '#64748b'
        }}>
          <span>
            Total: {items.length} items
          </span>
          <span>
            Completed: {items.filter(i => i.isCompleted).length}
          </span>
        </div>
      )}
    </div>
  );
};

export default ShoppingListManager;
